// App.js
import React from 'react';
import TopBar from '../../1/src/components/TopBar/TopBar.js';
import Header from '../../1/src/components/Header/Header.js';
import Hero from '../../1/src/components/Hero/Hero.js';
import Specials from '../../1/src/components/Specials/Specials.js';
import Events from '../../1/src/components/Events/Events.js';
import BookATable from '../../1/src/components/BookATable/BookATable.js';
import Testimonials from '../../1/src/components/Testimonials/Testimonials.js';
import Gallery from '../../1/src/components/Gallery/Gallery.js';
import Chefs from '../../1/src/components/Chefs/Chefs.js';
import Contact from '../../1/src/components/Contact/Contact.js';
import Footer from '../../1/src/components/Footer/Footer.js';
import Menu from '../../1/src/components/Menu/Menu.js';
import './App.css'; // Загальний файл стилів

const App = () => {
  return (
    <div className="app-background">
      <TopBar />
      <Header />
      <Hero />
      <main id="main">
        <Menu />
        <Specials />
        <Events />
        <BookATable />
        <Testimonials />
        <Gallery />
        <Chefs />
        <Contact />
      </main>
      <Footer />
    </div>
  );
};

export default App;
